\"173\">\r\n  <p class=\"MsoNormal\">Valoración de la importancia del cumplimiento del plan de\r\n  negocio en el desarrollo exitoso de una idea de negocio. (saber, ser)</p>\r\n  </td>\r\n  <td style=\"width:129.95pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\" style=\"mso-layout-grid-align:none;text-autospace:none\"><b style=\"mso-bidi-font-weight:normal\">EVALUACIÓN DEL PLAN DE NEGOCIO</b></p>\r\n  <p class=\"MsoNormal\" style=\"mso-layout-grid-align:none;text-autospace:none\">4.\r\n  Organización y Gestión: </p>\r\n  <p class=\"MsoNormal\">Planificación y temporalización, Organización Equipo, Gestión\r\n  de personal de negocio</p>\r\n  </td>\r\n  <td style=\"width:130.0pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\">Agregarle las partes de su Organización y Gestión del plan\r\n  de negocios a su página web. (ver blog)</p>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:2;height:53.85pt\">\r\n  <td style=\"width:129.95pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\" style=\"mso-layout-grid-align:none;text-autospace:none\"><a href=\"#Jurídico-fiscal\"><span style=\"color:windowtext;text-decoration:none;\r\n  text-underline:none\">5. Jurídico-fiscal</span></a>: <a href=\"#Determinación_de_la_forma_jurídica\"><span style=\"color:windowtext;\r\n  text-decoration:none;text-underline:none\">Determinación de la forma jurídica</span></a>,\r\n  <a href=\"#Aspectos_laborales_del_emprendedor\"><span style=\"color:windowtext;\r\n  text-decoration:none;text-underline:none\">Aspectos laborales del emprendedor</span></a>,\r\n  <a href=\"#Aspectos_laborales_y_seguridad_social_de\"><span style=\"color:windowtext;\r\n  text-decoration:none;text-underline:none\">Aspectos laborales y seguridad\r\n  social de los trabajadores</span></a>, <a href=\"#Obligaciones_fiscales\"><span style=\"color:windowtext;text-decoration:none;text-underline:none\">Obligaciones\r\n  fiscales</span></a>, <a href=\"#Permisos,_licencias_y_documentación_ofic\"><span style=\"color:windowtext;text-decoration:none;text-underline:none\">Permisos,\r\n  licencias y documentación oficial</span></a>, <a href=\"#Cobertura_de_responsabilidades\"><span style=\"color:windowtext;\r\n  text-decoration:none;text-underline:none\">Cobertura de responsabilidades</span></a>\r\n  y <a href=\"#Patentes,_marcas_y_otros_tipos_de_regist\"><span style=\"color:\r\n  windowtext;text-decoration:none;text-underline:none\">Patentes, marcas y otros\r\n  tipos de registros</span></a></p>\r\n  </td>\r\n  <td style=\"width:130.0pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\">Agregarle las partes Jurídico-fiscal del plan de negocios\r\n  a su página web. (ver blog)</p>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:3;mso-yfti-lastrow:yes;height:53.85pt\">\r\n  <td style=\"width:129.95pt;border:solid windowtext 1.0pt;\r\n  border-top:none;mso-border-top-alt:solid windowtext .5pt;mso-border-alt:solid windowtext .5pt;\r\n  padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-ansi-language:ES-CR\" lang=\"ES-CR\">TECNOLÓGICAS</span></b></p>\r\n  </td>\r\n  <td style=\"width:129.95pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\">Integración de las temáticas trabajadas en el período a\r\n  través de un producto informático. (hacer)</p>\r\n  </td>\r\n  <td style=\"width:129.95pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\" style=\"mso-layout-grid-align:none;text-autospace:none\">Uso\r\n  de herramientas web (web, almacenamiento en la nube)</p>\r\n  </td>\r\n  <td style=\"width:130.0pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt;height:53.85pt\" valign=\"top\" width=\"173\">\r\n  <p class=\"MsoNormal\">Cumplir con los criterios básicos para el diseño de una página\r\n  web, mirarlos en el blog.</p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:center\" align=\"center\">&nbsp;</p>\r\n\r\n', '1', 'privado'), ('220', 'active', 'Historia del computador', '<p>En 1670 el filósofo y matemático alemán <b>Gottfried Wilhelm Leibniz</b> perfeccionó la máquina de calcular de Pascal e inventó una que también podía multiplicar.<br><br>\r\n\r\nEl inventor francés <b>Joseph Marie Jacquard</b>, al diseñar un telar automático, utilizó delgadas placas de madera  \r\nperforadas para controlar el tejido utilizado en los diseños complejos. Durante la década de 1880 el estadístico  \r\nestadounidense <b>Herman Hollerith</b> concibió la idea de utilizar tarjetas perforadas, similares a las placas de  \r\nJacquard, para procesar datos. Hollerith consiguió compilar la información estadística destinada al censo de  \r\npoblación de 1890 de Estados Unidos mediante la utilización de un sistema que hacía pasar tarjetas perforadas  \r\nsobre contactos eléctricos.<br><br>\r\n\r\nTambién en el siglo XIX el matemático e inventor británico <b>Charles Babbage</b> elaboró los principios de la  \r\ncomputadora digital moderna. Inventó una serie de máquinas, como la máquina diferencial, diseñadas para  \r\nsolucionar problemas matemáticos complejos. Muchos historiadores consideran a Babbage y a su socia, la  \r\nmatemática británica <b>Augusta Ada Byron</b> (1815-1852), hija del poeta inglés Lord Byron, como a los verdaderos  \r\ninventores de la computadora digital moderna. La tecnología de aquella época no era capaz de trasladar a la  \r\npráctica sus acertados conceptos; pero una de sus invenciones, <b>la máquina analítica</b>, ya tenía muchas de las  \r\ncaracterísticas de un ordenador moderno. Incluía una corriente, o flujo de entrada en forma de paquete de  \r\ntarjetas perforadas, una memoria para guardar los datos, un procesador para las operaciones matemáticas y  \r\nuna impresora para hacer permanente el registro.<br><br>\r\n\r\nLos <b>ordenadores analógicos</b> comenzaron a construirse a principios del siglo XX. Los primeros modelos realizaban  \r\nlos cálculos mediante ejes y engranajes giratorios. Con estas máquinas se evaluaban las aproximaciones numéricas  \r\nde ecuaciones demasiado difíciles como para poder ser resueltas mediante otros métodos. Durante las dos guerras  \r\nmundiales se utilizaron sistemas informáticos analógicos, primero mecánicos y más tarde eléctricos, para predecir  \r\nla trayectoria de los torpedos en los submarinos y para el manejo a distancia de las bombas en la aviación.<br><br>\r\n\r\nDurante la II Guerra Mundial (1939-1945), un equipo de científicos y matemáticos que trabajaban en Bletchley  \r\nPark, al norte de Londres, crearon lo que se consideró el primer ordenador digital totalmente electrónico: el  \r\n<b>Colossus</b>. Hacia diciembre de 1943 el Colossus, que incorporaba 1.500 válvulas o tubos de vacío, era ya  \r\noperativo.  \r\nFue utilizado por el equipo dirigido por Alan Turing para descodificar los mensajes de radio cifrados de los  \r\nalemanes. En 1939 y con independencia de este proyecto, <b>John Atanasoff y Clifford Berry</b> ya habían construido  \r\nun prototipo de máquina electrónica en el Iowa State College (EEUU). Este prototipo y las investigaciones  \r\nposteriores se realizaron en el anonimato, y más tarde quedaron eclipsadas por el desarrollo del <b>Calculador e  \r\nintegrador numérico electrónico</b> (en inglés <b>ENIAC</b>, Electronic \r\nNumerical Integrator and Computer) en 1946. El ENIAC, que según se \r\ndemostró se basaba en gran medida en el ordenador Atanasoff-Berry (en \r\ninglés \r\n<b>ABC</b>, Atanasoff-Berry Computer), obtuvo una patente que caducó en 1973, varias décadas más tarde. <br><br>\r\n\r\nEl ENIAC contenía 18.000 válvulas de vacío y tenía una velocidad de varios cientos de multiplicaciones por  \r\nminuto, pero su programa estaba conectado al procesador y debía ser modificado manualmente. Se construyó un  \r\nsucesor del ENIAC con un almacenamiento de programa que estaba basado en los conceptos del matemático  \r\nhúngaro-estadounidense <b>John von Neumann</b>. Las instrucciones se almacenaban dentro de una llamada <b>memoria</b>,\r\n lo que liberaba al ordenador de las limitaciones de velocidad del \r\nlector de cinta de papel durante la ejecución y permitía resolver \r\nproblemas sin necesidad de volver a conectarse al ordenador. <br><br>\r\n\r\nA finales de la década de 1950 el uso del transistor en los ordenadores marcó el advenimiento de elementos  \r\nlógicos más pequeños, rápidos y versátiles de lo que permitían las máquinas con válvulas. Como los transistores  \r\nutilizan mucha menos energía y tienen una vida útil más prolongada, a su desarrollo se debió el nacimiento de  \r\nmáquinas más perfeccionadas, que fueron llamadas <b>ordenadores o computadoras de segunda generación</b>. Los  \r\ncomponentes se hicieron más pequeños, así como los espacios entre ellos, por lo que la fabricación del  \r\nsistema resultaba más barata.<br><br>\r\n\r\nA finales de la década de 1960 apareció el <b>circuito integrado (CI)</b>, que posibilitó la fabricación de varios  \r\ntransistores en un único sustrato de silicio en el que los cables de interconexión iban soldados. El circuito  \r\nintegrado permitió una posterior reducción del precio, el tamaño y los porcentajes de error. El <b>microprocesador</b>  \r\nse convirtió en una realidad a mediados de la década de 1970, con la introducción del <b>circuito de integración  \r\na gran escala</b> (<b>LSI</b>, acrónimo de Large Scale Integrated) y, más tarde, con el <b>circuito de integración a mayor \r\nescala</b> (<b>VLSI</b>, acrónimo de Very Large Scale Integrated), con varios miles de transistores \r\ninterconectados soldados sobre un único sustrato de silicio.<br></p>', '1', 'privado'), ('221', 'inactive', 'Grandes personalidades de la tecnología', '<p>Vamos a conocer un poco sobre grandes personalidades de la tecnología.&nbsp;</p><p><br></p><p><iframe webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" src=\"//player.vimeo.com/video/120837467\" width=\"640\" height=\"360\" frameborder=\"0\"></iframe><br></p><p><br></p>', '1', 'privado'), ('222', 'inactive', 'Grandes personalidades de la tecnología', '<p>Vamos a conocer un poco sobre grandes personalidades de la tecnología.&nbsp;</p><p><br></p><p><iframe webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" src=\"//player.vimeo.com/video/120837467\" width=\"640\" height=\"360\" frameborder=\"0\"></iframe><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', '1', 'privado'), ('223', 'inactive', 'Grandes personalidades de la tecnología', '<p>Vamos a conocer un poco sobre grandes personalidades de la tecnología.&nbsp;</p><p><br></p><p><iframe webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" src=\"//player.vimeo.com/video/120837467\" width=\"640\" height=\"360\" frameborder=\"0\"></iframe><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', '1', 'privado'), ('224', 'inactive', 'Grandes personalidades de la tecnología', '<p>Vamos a conocer un poco sobre grandes personalidades de la tecnología.&nbsp;</p><p><br></p><p><iframe webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" src=\"//player.vimeo.com/video/120837467\" width=\"640\" height=\"360\" frameborder=\"0\"></iframe><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', '1', 'privado'), ('225', 'active', 'Grandes personalidades de la tecnología - Win', '<p><span style=\"font-weight: bold; font-size: 18px;\">Conoce un poco sobre el fundador de Microsoft !!!!</span></p><p><br></p><p><iframe webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" src=\"//player.vimeo.com/video/120837467\" width=\"640\" height=\"360\" frameborder=\"0\"></iframe><br></p>', '1', 'privado'), ('226', 'active', ' Top 10 empresas más importantes en Internet', '<div class=\"post-body entry-content\">\r\n<p>\r\nOs presentamos el Top 10 de las Empresas más importantes en el Mundo de Internet. <br><br>\r\nLa página web especializada en internet, www.statista.com, ha publicado la lista de las 10 empresas más importantes en Internet 2013. Este estudio se ha realizado en base a búsquedas-audiencias en Internet del mes de Julio de 2012 a Julio del 2013 y conforme a ello se ha elaborado el ranking final.<br>\r\n<br>\r\n<br>\r\n<b>1. GOOGLE (1.209 millones de audiencia)</b><br>\r\n<img src=\"https://lh6.googleusercontent.com/-iJ-_loWr8CA/UeBxPcotWvI/AAAAAAAAL1I/HF0v9atVzUQ/w600-h400-no/1.jpg\" alt=\"Google\" width=\"600\">\r\n<br>\r\nGoogle Inc. es la empresa propietaria de la marca Google, cuyo principal producto es el motor de búsqueda de contenido en Internet del mismo nombre. <br>\r\n<br>\r\n<iframe width=\"600\" height=\"338\" src=\"//www.youtube.com/embed/-S61GzAInlA\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.google.es\" target=\"_blank\">google.es</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>2. MICROSOFT (878 millones de audiencia)</b><br>\r\n<img src=\"https://lh6.googleusercontent.com/-iab_M4Yd9N0/UeRl6dtuKbI/AAAAAAAAL5o/n-nmgzOgiiU/w600-h429-no/2.jpg\" alt=\"Microsoft\" width=\"600\">\r\n<br>\r\nMicrosoft Corporation es una empresa multinacional de origen estadounidense, fundada el 4 de Abril de 1975 por Bill Gates y Paul Allen. Dedicada al sector del software, tiene su sede en Redmond, Washington, Estados Unidos. <br>\r\nMicrosoft desarrolla, fabrica, licencia y produce software y equipos electrónicos, siendo sus productos más usados el sistema operativoMicrosoft Windows y la suite Microsoft Office, los cuales tienen una importante posición entre los ordenadores personales.<br>\r\n<br>\r\n<iframe width=\"600\" height=\"338\" src=\"//www.youtube.com/embed/ad4m9U_u7X4\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.microsoft.com\" target=\"_blank\">microsoft.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>3. FACEBOOK (797 millones de audiencia)</b><br>\r\n<img src=\"https://lh3.googleusercontent.com/-GonTmQInyeY/UOnfxhM0KaI/AAAAAAAAHmU/tImsTCLiuc8/s474/FACEBOOK.jpg\" alt=\"Facebook\" width=\"600\">\r\n<br>\r\nEs un sitio web gratuito de redes sociales creado por Mark Zuckerberg para conectar a personas, para mantenerse al día con amigos, subir fotos, compartir enlaces y videos.<br>\r\n<br>\r\n<iframe width=\"600\" height=\"338\" src=\"http://www.youtube.com/embed/_TuFkupUn7k\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.facebook.com\" target=\"_blank\">facebook.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>4. YAHOO (725 millones de audiencia)</b><br>\r\n<img src=\"https://lh6.googleusercontent.com/-Hp7a9YWe5Jk/UOnf0KIBv4I/AAAAAAAAHnE/salCpo7Q9cM/s474/YAHOO.jpg\" alt=\"Yahoo\" width=\"600\">\r\n<br>\r\nEs una empresa global de medios con sede en Estados Unidos, cuya misión es \"ser el servicio global de Internet más esencial para consumidores y negocios\". Posee un portal de Internet, un directorio web y una serie de servicios, incluido el popular correo electrónico Yahoo!. Fue fundada en enero de 1994 por dos estudiantes de postgrado de la Universidad de Stanford, Jerry Yang y David Filo. <br>\r\n<br>\r\n<a href=\"http://yahoo.com\" target=\"_blank\">yahoo.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>5. WIKIPEDIA (429 millones de audiencia)</b><br>\r\n<img src=\"https://lh6.googleusercontent.com/-9Zjf3uBOgGY/UOnfzYM4L5I/AAAAAAAAHmo/dgkcUsZknRU/s474/WIKIPEDIA.jpg\" alt=\"Wikipedia\" width=\"600\">\r\n<br>\r\nWikipedia es una enciclopedia libre y políglota de la Fundación Wikimedia —una organización sin ánimo de lucro—. Sus más de 20 millones de artículos en 282 idiomas y dialectos han sido redactados conjuntamente por voluntarios de todo el mundo, y prácticamente cualquier persona con acceso al proyecto puede editarlos. Iniciada en enero de 2001 por Jimmy Wales y Larry Sanger, es actualmente la mayor y más popular obra de consulta en Internet. <br>\r\n<br>\r\n<iframe width=\"600\" height=\"338\" src=\"http://www.youtube.com/embed/z2L0EdoNQW0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.wikipedia.org\" target=\"_blank\">wikipedia.org</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>6. AMAZON (404 millones de audiencia)</b><br>\r\n<img src=\"https://lh3.googleusercontent.com/-LHZObVNSAzY/UOnfxT-h7LI/AAAAAAAAHmQ/YR-XuKnEk0s/s474/AMAZON.jpg\" alt=\"Amazon\" width=\"600\">\r\n<br>\r\nAmazon.com, es una compañía estadounidense de comercio electrónico y servicios de cloud computing a todos los niveles con sede en Seattle, Estado de Washington. Su lema es and you\'re done. Fue una de las primeras grandes compañías en vender bienes a través de Internet.<br>\r\n<br>\r\n<iframe width=\"600\" height=\"450\" src=\"http://www.youtube.com/embed/VeReSNCT6Oo\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.amazon.com\" target=\"_blank\">amazon.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>7. BAIDU (358 millones de audiencia)</b><br>\r\n<img src=\"https://lh4.googleusercontent.com/-XkGdK5uOyGM/UOnfxmS7jMI/AAAAAAAAHmY/dJGZKBK869w/s474/BAIDU.jpg\" alt=\"Baidu\" width=\"600\">\r\n<br>\r\nBaidu es un motor de búsqueda en idioma chino con sede en Pekín fundado a finales de 1999 por Robin Li y Eric Xu. Su diseño es similar al de Google e incluye la posibilidad de búsqueda de noticias, imágenes y canciones, entre otras funciones.<br>\r\n<br>\r\n<a href=\"http://www.baidu.com\" target=\"_blank\">baidu.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>8. TENCENT (341 millones de audiencia)</b><br>\r\n<img src=\"https://lh5.googleusercontent.com/-_6c-AJoBvl8/UnursuGGbkI/AAAAAAAAPRA/InvpiqepgFI/w600-h338-no/11.jpg\" alt=\"Tencent\" width=\"600\">\r\n<br>\r\nTencent Holdings Limited es una empresa de China cuyas subsidiarias proveen servicios de internet y servicios de teléfonos móviles de valor agregado, además de ofrecer servicios de publicidad online en China <br>\r\nEntre los diversos servicios que ofrece son de redes sociales, portales de sitios web, comercio electrónico (e-commerce), juegos y servicio de mensajería instantánea conocido como Tencent QQ, a su vez es el portal de internet más grande de China. <br>\r\n<br>\r\n<iframe width=\"600\" height=\"338\" src=\"//www.youtube.com/embed/tIFCXuOa-Ew\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.tencent.com\" target=\"_blank\">tencent.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>9. ALIBABA (318 millones de audiencia)</b><br>\r\n<img src=\"https://lh6.googleusercontent.com/-Z3ldfF3CnhA/UnursuYp2TI/AAAAAAAAPRE/GshoJSbdQUs/w600-h174-no/22.jpg\" alt=\"Alibaba\" width=\"600\">\r\n<br>\r\nAlibaba Group es un grupo con sede en Hangzhou propiedad privada de las empresas de comercio electrónico basado en Internet incluyendo portales web online business-to-business, servicios al por menor y el pago en línea, un motor de búsqueda de compras y servicios computación en la nube centrados en datos.<br>\r\n<br>\r\n<iframe width=\"600\" height=\"338\" src=\"//www.youtube.com/embed/ZCWRIzdFMSM\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\r\n<br>\r\n<a href=\"http://www.alibaba.com\" target=\"_blank\">alibaba.com</a>\r\n<br>\r\n<br>\r\n<br>\r\n<b>10. SOHU (318 millones de audiencia)</b><br>\r\n<img src=\"https://lh5.googleusercontent.com/-4vRuvry6ICc/UnurtMhRXPI/AAAAAAAAPRI/YiXLOFhnoaM/w600-h450-no/33.jpg\" alt=\"Sohu\" width=\"600\">\r\n<br>\r\nSohu es un importante proveedor de servicios de internet en la República Popular de China. Tiene su sede en el Sohu.com Internet Plaza, en Haidian, Pekín. <br>\r\nLa compañía y sus subsidiarias ofrecen contenido, clasificados, búsquedas patrocinadas, juegos, comercio electrónico en línea e inalámbrico, a través de una matriz compuesta de servicios web que incluyen el portal masivo y uno de los destinos en línea más visitados. <br>\r\n<br>\r\n<a href=\"http://www.sohu.com\" target=\"_blank\">sohu.com</a>\r\n</p>\r\n<div style=\"clear:both;\"></div>\r\n<div class=\"post-share-buttons\">\r\n<a class=\"goog-inline-block share-button sb-email\" href=\"http://www.blogger.com/share-post.g?blogID=1368636287114380344&postID=2498665508880796938&target=email\" target=\"_blank\" title=\"Enviar por correo electrónico\">\r\n<span class=\"share-button-link-text\">\r\nEnviar por correo electrónico\r\n</span>\r\n</a>\r\n<a class=\"goog-inline-block share-button sb-blog\" href=\"http://www.blogger.com/share-post.g?blogID=1368636287114380344&postID=2498665508880796938&target=blog\" onclick=\"window.open(this.href, \" _blank\",=\"\" \"height=\"270,width=475\");\" return=\"\" false;\"=\"\" target=\"_blank\" title=\"Escribe un blog\">\r\n<span class=\"share-button-link-text\">\r\nEscribe un blog\r\n</span>\r\n</a>\r\n<a class=\"goog-inline-block share-button sb-twitter\" href=\"http://www.blogger.com/share-post.g?blogID=1368636287114380344&postID=2498665508880796938&target=twitter\" target=\"_blank\" title=\"Compartir con Twitter\">\r\n<span class=\"share-button-link-text\">\r\nCompartir con Twitter\r\n</span>\r\n</a>\r\n<a class=\"goog-inline-block share-button sb-facebook\" href=\"http://www.blogger.com/share-post.g?blogID=1368636287114380344&postID=2498665508880796938&target=facebook\" onclick=\"window.open(this.href, \" _blank\",=\"\" \"height=\"430,width=640\");\" return=\"\" false;\"=\"\" target=\"_blank\" title=\"Compartir con Facebook\">\r\n<span class=\"share-button-link-text\">\r\nCompartir con Facebook\r\n</span>\r\n</a>\r\n<div class=\"goog-inline-block dummy-container\">\r\n<div id=\"___plusone_0\" style=\"text-indent: 0px; margin: 0px; padding: 0px; border-style: none; float: none; line-height: normal; font-size: 1px; vertical-align: baseline; display: inline-block; width: 300px; height: 20px; background: transparent;\"><iframe frameborder=\"0\" hspace=\"0\" marginheight=\"0\" marginwidth=\"0\" scrolling=\"no\" style=\"position: static; top: 0px; width: 300px; margin: 0px; border-style: none; left: 0px; visibility: visible; height: 20px;\" tabindex=\"0\" vspace=\"0\" width=\"100%\" id=\"I0_1436376922491\" name=\"I0_1436376922491\" src=\"https://apis.google.com/u/0/se/0/_/+1/fastbutton?usegapi=1&source=blogger%3Ablog%3Aplusone&size=medium&width=300&annotation=inline&hl=es&origin=http%3A%2F%2Fwww.top10listas.com&url=http%3A%2F%2Fwww.top10listas.com%2F2013%2F12%2Ftop-10-empresas-mas-importantes-en.html&gsrc=3p&ic=1&jsh=m%3B%2F_%2Fscs%2Fapps-static%2F_%2Fjs%2Fk%3Doz.gapi.es_419.gC6-PoAHorw.O%2Fm%3D__features__%2Fam%3DQQ%2Frt%3Dj%2Fd%3D1%2Ft%3Dzcms%2Frs%3DAGLTcCMzBmCjXULIAz2UKCduv_bB1St29Q#_methods=onPlusOne%2C_ready%2C_close%2C_open%2C_resizeMe%2C_renderstart%2Concircled%2Cdrefresh%2Cerefresh&id=I0_1436376922491&parent=http%3A%2F%2Fwww.top10listas.com&pfname=&rpctoken=18124215\" data-gapiattached=\"true\" title=\"+1\"></iframe>sdfg </div></div>\r\n</div>\r\n<span class=\"reaction-buttons\">\r\n</span>\r\n<div style=\"clear: both;\"></div>\r\n</div>', '1', 'privado');
