`id_contenido`  int(11) NOT NULL ,
`id_document_adj`  int(11) NOT NULL ,
PRIMARY KEY (`id_contenido`, `id_document_adj`),
FOREIGN KEY (`id_contenido`) REFERENCES `contenidos` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
FOREIGN KEY (`id_document_adj`) REFERENCES `documentos_adjuntos` (`id_doc_adj`) ON DELETE RESTRICT ON UPDATE CASCADE,
INDEX `id_contenido` (`id_contenido`) USING BTREE ,
INDEX `id_document_adj` (`id_document_adj`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=latin1 COLLATE=latin1_swedish_ci

;

